import { Row, Col } from "antd";
import { LocationGrid } from "../common/Grid";

import LocationCard from "../common/LocationCard";

const Locations = ({ locations, type }) => {
  return (
    <div className="profile-characters">
      <LocationGrid
        locations={locations}
        xxl={4}
        sm={12}
        sx={12}
        md={8}
        xl={6}
        lg={8}
        gutter={[16, 16]}
        type={type}
      />
      <Row gutter={[16, 16]}>
        <Col xxl={4} xl={6} lg={8}>
          <LocationCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <LocationCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <LocationCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <LocationCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <LocationCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <LocationCard />
        </Col>
      </Row>
    </div>
  );
};

export default Locations;
